import React from "react";
import Card from 'react-bootstrap/Card';

export default function LoginByPhoneNumber() {
    const styles = {
        cardHeaderLg: {
            position: 'absolute',
            left: '20px',
            right: '20px',
            top: '-20px',
            background: "linear-gradient(90deg, #26a69a, #69d4a5)",
            color: 'white',
            borderRadius: '10px',
            fontWeight: 'bold',
            fontSize: "1.5rem"
        },
        cardHeaderSm: {
            position: 'absolute',
            left: '20px',
            top: '-20px',
            background: "linear-gradient(90deg, #26a69a, #69d4a5)",
            color: 'white',
            borderRadius: '10px',
            fontWeight: 'bold',
            fontSize: "1.2rem"
        },
    }

    return (
        <div className="w-100 d-flex justify-content-center mt-5">
            <Card>
                <Card.Header styles={styles.cardHeaderSm} className="h3">
                    Sign in By Phone Number
                </Card.Header>

                <Card.Body>

                </Card.Body>

                <Card.Footer>

                </Card.Footer>
            </Card>
        </div>
    )
}
